import React from 'react';
import './Toolstack.css';

const Toolstack = () => {
  const tools = [
    {
      name: "VS Code",
      icon: "üíª",
      color: "#007ACC"
    },
    {
      name: "GitHub",
      icon: "üêô",
      color: "#181717"
    },
    {
      name: "Postman",
      icon: "üìÆ",
      color: "#FF6C37"
    },
    {
      name: "Figma",
      icon: "üé®",
      color: "#F24E1E"
    },
    {
      name: "Docker",
      icon: "üê≥",
      color: "#2496ED"
    },
    {
      name: "Heroku",
      icon: "üöÄ",
      color: "#430098"
    },
    {
      name: "Vercel",
      icon: "‚ñ≤",
      color: "#000000"
    },
    {
      name: "Netlify",
      icon: "üåê",
      color: "#00C7B7"
    }
  ];

  return (
    <div className="toolstack-container">
      <div className="toolstack-grid">
        {tools.map((tool, index) => (
          <div 
            key={index} 
            className="tool-item"
            style={{ '--tool-color': tool.color }}
          >
            <div className="tool-icon">{tool.icon}</div>
            <div className="tool-name">{tool.name}</div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Toolstack;
